import styled from 'styled-components';
import theme from 'themes/theme';

const IconWrapper = styled.span`
  color: ${({ $color }) => $color || theme.colors.primary.light};
  width: ${({ $size }) => ($size ? `${$size}px` : '1em')};
  height: ${({ $size }) => ($size ? `${$size}px` : '1em')};
`;

const Icon = ({
  className, size, children, color,
}) => (
  <IconWrapper className={`Icon ${className || ''}`} $color={color}>
    <svg
      viewBox="0 0 24 24"
      width={size ? `${size}px` : '1em'}
      height={size ? `${size}px` : '1em'}
      fill="currentColor"
      fillRule="evenodd"
      clipRule="evenodd"
    >
      {children}
    </svg>
  </IconWrapper>
);

